Pru=PPru.split(',')
Sie=SSie.split(',')



def count(string, minLen):
    pattern = '[^A-Za-z0-9]+'
    words = [x.lower() for x in re.split(pattern, string)]
    validWords = [x for x in words if len(x) >= minLen]

    mic = 0
    pru = 0
    sie = 0
    for word in validWords:
        if (word in Mic):
            mic += 1
        if (word in Pru):
            pru += 1
        if (word in Sie):
            sie += 1

    return np.argmax((mic, pru, sie))

